#!/bin/bash

# Colors
RED="\e[31m"
GREEN="\e[32m"
YELLOW="\e[33m"
BLUE="\e[34m"
MAGENTA="\e[35m"
CYAN="\e[36m"
GREY="\e[37m"
LIGHT="\e[1m"
RESET="\e[0m"

# Símbols
TICK="\xE2\x9C\x93"
CROSS="\xE2\x9C\x98"

# Usuari actual
CURRENTUSER=$(whoami)

# Working directory
THIS_SCRIPT=$(basename "$0")
ORIGINDIR=$(pwd)
THIS_SCRIPT_FULLNAME="$ORIGINDIR/$THIS_SCRIPT"
WORKINGDIR="/opt/gns3"
UNINSTALLER="$ORIGINDIR/un$THIS_SCRIPT"
LOGFILE="$ORIGINDIR/install-gns3.log"
#LOGFILE="/dev/null"

# Versions
UBRIDGE="0.9.16"
DYNAMIPS="0.2.23"
VPCS="0.6.1"

# Noms
NAME_UBRIDGE="v$UBRIDGE.tar.gz"
NAME_DYNAMIPS="v$DYNAMIPS.tar.gz"
NAME_VPCS="vpcs"
NAME_ASSETS="gns3-gui-desktop.tar.gz"

# URL
URL_UBRIDGE="https://github.com/GNS3/ubridge/archive/$NAME_UBRIDGE"
URL_DYNAMIPS="https://github.com/GNS3/dynamips/archive/$NAME_DYNAMIPS"
URL_VPCS="https://github.com/GNS3/vpcs/releases/download/v$VPCS/$NAME_VPCS"
URL_ASSETS="https://www.bernhard-ehlers.de/blog/assets/2019-03-26-gns3-install-debian/$NAME_ASSETS"

# Usage
function info_usage {
	echo
	echo -e "$LIGHT Ús: $THIS_SCRIPT <usuari>$RESET"
	echo
	exit
}

# Marca OK a la caixeta
function info_result_tick {
	echo -e "\r$LIGHT$GREY [ $GREEN$TICK$GREY ]$RESET $1"
}

# Marca KO a la caixeta
function info_result_cross {
	echo -e "\r$LIGHT$GREY [ $RED$CROSS$GREY ]$RESET $1"
}

# Gira dins la caixeta mentre no acabi el procés i posa el resultat a la caixeta
function info_progress_check {
	# Spin
	SPIN="-\|/"

	# Que vagi girant mentre no acaba el procés
	i=0
	while kill -0 $1 2>/dev/null; do
		i=$(( (i+1) %4 ))
		echo -ne "\r$LIGHT$GREY [$YELLOW ${SPIN:$i:1} $GREY]$RESET $2"
		sleep 0.1
	done

	# Veiem el resultat del procés acabat
	wait $1
	info_result_check $? $2
}

function info_result_check {
	case $1 in
	0)
		echo -e "\r$LIGHT$GREY [ $GREEN$TICK$GREY ]$RESET $2"
		;;
	*)
		echo -e "\r$LIGHT$GREY [ $RED$CROSS$GREY ]$RESET $2"
		echo
		echo -e "$LIGHT$RED Consulta l'error a $LOGFILE$RESET"
		echo
		exit
		;;
	esac
}

# Genera desinstal.lador buit
function uninstaller_init {
	rm -f "$UNINSTALLER"
	echo > $UNINSTALLER
}

# Posa text a l'inici del desinstal.lador
function uninstaller_prepend {
	echo "$1" | cat - $UNINSTALLER > temp && mv temp $UNINSTALLER
#	sed -i "1s/^/$1\n/" $UNINSTALLER
}

# Posa text al final del desinstal.lador
function uninstaller_append {
	echo "$1" >> $UNINSTALLER
}


# Primera sortida
clear
echo
echo -e "$LIGHT$BLUE -----------------------------------------------$RESET"
echo -e "$LIGHT$BLUE -    Instal.lador de GNS3 des de codi font    -$RESET"
echo -e "$LIGHT$BLUE -----------------------------------------------$RESET"
echo -e "$LIGHT$BLUE -- Departament d'Informàtica i Comunicacions --$RESET"
echo -e "$LIGHT$BLUE ------------ Institut Mediterrània ------------$RESET"
echo -e "$LIGHT$BLUE -----------------------------------------------$RESET"
echo

# Comprova usuari
if [ "$CURRENTUSER" != "root" ]; then
	info_result_cross "Aquest script s'ha d'executar com a root"
	info_usage
fi
info_result_tick "Comprovació d'usuari root"

# Comprova número de paràmetres
if [ $# -ne 1 ]; then
	info_result_cross "Cal donar permisos a un usuari per a executar GNS3"
	info_usage
fi

# Usuari del paràmetre
USUARI=$1
USUARI_HOME=$(getent passwd "$USUARI" | cut -d":" -f6)

# Comprova que l'usuari existeix
id -u $USUARI > $LOGFILE 2>&1
if [ $? -ne 0 ]; then
	info_result_cross "L'usuari '$USUARI' no existeix"
	info_usage
fi

info_result_tick "L'usuari '$USUARI' tindrà permís per a executar GNS3"

# Comprova directoris
if [ -d "$WORKINGDIR" ]; then
	rm -rf "$WORKINGDIR" 2>>$LOGFILE &
	info_progress_check $! "Esborrant instal.lació pendent de GNS3 a $WORKINGDIR"
fi
if [ -f "$WORKINGDIR" ]; then
	rm -f "$WORKINGDIR" 2>>$LOGFILE
	info_result_check $? "Esborrant arxiu $WORKINGDIR"
fi

mkdir -p "$WORKINGDIR" 2>>$LOGFILE
cd "$WORKINGDIR" 2>>$LOGFILE
info_result_check $? "Treballant a $(pwd)"

# Downloads

echo
#wget -q -a $LOGFILE -P $WORKINGDIR "$URL_ASSETS" &
#info_progress_check $! "Descarregant arxiu desktop, icones i MIME"
#wget -q -a $LOGFILE -P $WORKINGDIR "$URL_UBRIDGE" &
#info_progress_check $! "Descarregant uBridge $UBRIDGE"
#wget -q -a $LOGFILE -P $WORKINGDIR "$URL_DYNAMIPS" &
#info_progress_check $! "Descarregant Dynamips $DYNAMIPS"
#wget -q -a $LOGFILE -P $WORKINGDIR "$URL_VPCS" &
#info_progress_check $! "Descarregant VPCS $VPCS"
sed '296q;d' $THIS_SCRIPT_FULLNAME | base64 -d - > $WORKINGDIR/$NAME_ASSETS
info_result_check $? "Extreient arxiu desktop, icones i MIME"
sed '300q;d' $THIS_SCRIPT_FULLNAME | base64 -d - > $WORKINGDIR/$NAME_UBRIDGE
info_result_check $? "Extreient uBridge $UBRIDGE"
sed '304q;d' $THIS_SCRIPT_FULLNAME | base64 -d - > $WORKINGDIR/$NAME_DYNAMIPS
info_result_check $? "Extreient Dynamips $DYNAMIPS"
sed '308q;d' $THIS_SCRIPT_FULLNAME | base64 -d - > $WORKINGDIR/$NAME_VPCS
info_result_check $? "Extreient VPCS $VPCS"
echo

# Generar uninstaller buit
uninstaller_init

# Actualitzar llista de paquets al repo
apt-get update >> $LOGFILE 2>&1 &
info_progress_check $! "Actualitzant llista de paquets disponibles"

# Instal.lar paquets
PAQUETS=( gcc make cmake libelf-dev libpcap0.8-dev python3-setuptools python3-pip python3-pyqt5 python3-pyqt5.qtsvg python3-pyqt5.qtwebsockets qemu-system-x86 lvm2 libvirt-daemon-system )
for PAQUET in "${PAQUETS[@]}"; do
	PAQUET_OK=$(dpkg -l $PAQUET 2>>$LOGFILE | grep "ii" | wc -l)
	if [ "$PAQUET_OK" == "1" ]; then
		info_result_tick "Saltant $PAQUET ja instal.lat"
	else
		apt-get -y install $PAQUET >> $LOGFILE 2>&1 &
		info_progress_check $! "Instal.lant $PAQUET"
		uninstaller_append "apt-get -y purge $PAQUET"
	fi
done
uninstaller_append "apt-get -y autoremove"
echo

# Instal.lar GNS3
pip3 install gns3-server >> $LOGFILE 2>&1 &
info_progress_check $! "Instal.lant servidor GNS3"
uninstaller_prepend "pip3 uninstall -y gns3-server"
pip3 install gns3-gui >> $LOGFILE 2>&1 &
info_progress_check $! "Instal.lant client GNS3"
uninstaller_prepend "pip3 uninstall -y gns3-gui"
uninstaller_prepend "#!/bin/bash"

# Instal.lar VPCS
install $WORKINGDIR/vpcs /usr/local/bin >> $LOGFILE 2>&1 &
info_progress_check $! "Instal.lant VPCS $VPCS"
uninstaller_append "rm -f /usr/local/bin/vpcs"

# Instal.lar uBridge
echo
tar zxf $WORKINGDIR/v$UBRIDGE.tar.gz -C $WORKINGDIR &
info_progress_check $! "Descomprimint uBridge"
cd "$WORKINGDIR/ubridge-$UBRIDGE" 2>>$LOGFILE
info_result_check $? "Iniciant instal.lació uBridge $UBRIDGE"
make >> $LOGFILE 2>&1 &
info_progress_check $! "Executant make"
make install >> $LOGFILE 2>&1 &
info_progress_check $! "Executant make install"

# Instal.lar Dynamips
echo
tar zxf $WORKINGDIR/v$DYNAMIPS.tar.gz -C $WORKINGDIR &
info_progress_check $! "Descomprimint Dynamips"
mkdir "$WORKINGDIR/dynamips-$DYNAMIPS/build" 2>>$LOGFILE
cd "$WORKINGDIR/dynamips-$DYNAMIPS/build" 2>>$LOGFILE
info_result_check $? "Iniciant instal.lació Dynamips $DYNAMIPS"
cmake .. >> $LOGFILE 2>&1 &
info_progress_check $! "Executant cmake"
make >> $LOGFILE 2>&1 &
info_progress_check $! "Executant make"
make install >> $LOGFILE 2>&1 &
info_progress_check $! "Executant make install"

# Instal.lar assets
echo
tar zxf $WORKINGDIR/gns3-gui-desktop.tar.gz -C /usr/local/share/ &
info_progress_check $! "Descomprimint arxiu desktop, icones i MIME"
uninstaller_append "find /usr/local/share -type f -name '*gns3*' -delete"
update-mime-database /usr/local/share/mime &
info_progress_check $! "Actualitzant MIME"
uninstaller_append "update-mime-database /usr/local/share/mime"
update-desktop-database /usr/local/share/applications &
info_progress_check $! "Actualitzant arxiu desktop i icones"
uninstaller_append "update-desktop-database /usr/local/share/applications"

# Afegir usuari al grup kvm
echo
usermod -a -G kvm $USUARI >> $LOGFILE 2>&1 &
info_progress_check $! "Afegint l'usuari '$USUARI' al grup 'kvm'"
uninstaller_append "gpasswd -d $USUARI kvm"

# Activar IP forward a sysctl sense requerir reboot
echo "net.ipv4.ip_forward=1" > /etc/sysctl.d/ip_forward.conf
sysctl --system >> $LOGFILE 2>&1 &
info_progress_check $! "Activant IP Forwarding a sysctl"
uninstaller_append "rm -f /etc/sysctl.d/ip.forward.conf"
uninstaller_append "sysctl --system"

# Activar xarxa virtual
virsh net-autostart default >> $LOGFILE 2>&1 &
info_progress_check $! "Activant inici automàtic de xarxa virtual"

# Retocs finals
echo
uninstaller_append "rm -rf $USUARI_HOME/.config/GNS3"
cd "$ORIGINDIR" 2>>$LOGFILE
info_result_check $? "Tornant a $ORIGINDIR"
chmod 755 "$UNINSTALLER" 2>>$LOGFILE
info_result_check $? "Desinstal.lador disponible a $UNINSTALLER"
rm -rf "$WORKINGDIR" 2>>$LOGFILE &
info_progress_check $! "Eliminant arxius temporals de $WORKINGDIR"
rm -f "$LOGFILE" 2>/dev/null
info_result_check $? "Netejant"

echo
echo -e "$LIGHT$GREEN Tot ha sortit bé :)$RESET"
echo
exit 0

